Cast: Gracie Glam, Lexi Swallows, Riley Steele, Victoria White

Sexy, seductive Riley Steele discovers a weak link in her marriage as perverted visions and dreams continue to haunt her, even after her wedding. The mysterious watches given as an engagement gift from friends they thought they could trust, turn out to be laced with the outlandish ability to give the wearer a glimpse into a future affair of their spouse, or a return of an old flame. Convinced her new husband is having a lusty affair, the emotional and sexual connetion is broken by an unexpected visit from her brother-in-law and his highly sexually charged girlfriend. Cast: Gracie Glam, Lexi Swallow, Marcus London, Mick Blue, Riley Steele, Tommy Gunn, Victoria WhitePlease note that this is a Blu-ray formatted disc. This disc can only be played on a Blu-ray compatible PC, Blu-ray player, or a Playstation 3 of any model.
